import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Items from './Items/items';  

function Home() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="src\Components\Items\Items.js" element={<Items />} />  {/* Define a route */}
      </Routes>
    </BrowserRouter>
  );
}

export default Home;
